	exseq_FSM_Festo1__Errors();
	stateConfVector[17] = FSM::State::NO_STATE;
	stateConfVectorPosition = 17;
	exseq_FSM_Festo2__Sorting();
	stateConfVector[18] = FSM::State::NO_STATE;
